import { Component } from '@angular/core';
import { ApiService } from '../api.service';

interface ApiParam {
  key: string;
  value: string;
}

interface ApiHeader {
  key: string;
  value: string;
}

interface ChainParam {
  key: string;
  sourceKey: string;
}

interface Api {
  method: string;
  url: string;
  params: ApiParam[];
  headers: ApiHeader[];
  jsonBody: string;
  chainParams: ChainParam[];
}

interface ApiResponse {
  body: any;
  status_code: number;
  content_type: string;
}

@Component({
  selector: 'app-api-integration',
  templateUrl: './api-integration.component.html',
  styleUrls: ['./api-integration.component.css']
})
export class ApiIntegrationComponent {
  apis: Api[] = [
    { method: 'GET', url: '', params: [], headers: [], jsonBody: '', chainParams: [] }
  ];
  responses: ApiResponse[] = [];

  constructor(private apiService: ApiService) { }

  addApi() {
    this.apis.push({ method: 'GET', url: '', params: [], headers: [], jsonBody: '', chainParams: [] });
  }

  removeApi(index: number) {
    this.apis.splice(index, 1);
  }

  runTests() {
    const results: ApiResponse[] = [];

    const executeApi = (index: number) => {
      if (index >= this.apis.length) {
        this.responses = results;
        return;
      }

      const api = this.apis[index];

      // Replace chain parameters with actual values from the previous API response
      if (index > 0) {
        const previousApiResponse = results[index - 1].body;
        api.chainParams.forEach((chainParam: ChainParam) => {
          const value = this.searchKeyInJson(previousApiResponse, chainParam.sourceKey);
          if (value) {
            const param = api.params.find((p: ApiParam) => p.key === chainParam.key);
            if (param) {
              param.value = value;
            }
          }
        });
      }

      const formattedApi = {
        ...api,
        body: api.method === 'POST' || api.method === 'PUT' ? api.jsonBody : ''
      };

      this.apiService.runTests([formattedApi]).subscribe((data: { responses: ApiResponse[] }) => {
        results.push(data.responses[0]);
        executeApi(index + 1);
      });
    };

    executeApi(0);
  }

  // Function to search for a key in a JSON object
  searchKeyInJson(obj: any, key: string): any {
    if (!obj || typeof obj !== 'object') return null;
    if (obj.hasOwnProperty(key)) return obj[key];

    for (const k in obj) {
      if (obj.hasOwnProperty(k) && typeof obj[k] === 'object') {
        const result = this.searchKeyInJson(obj[k], key);
        if (result) return result;
      }
    }

    return null;
  }
}
<div>
    <div *ngFor="let api of apis; let i = index" class="card mb-3">
        <div class="card-body">
            <app-add-api-form [api]="api" [index]="i" (remove)="removeApi($event)"></app-add-api-form>
        </div>
    </div>
    <div class=""text-center mb-4>
        <button class="btn btn-primary mr-2" (click)="addApi()">Add API</button>
        <button class="btn btn-success" (click)="runTests()">Run</button>
    </div>
    <div *ngFor="let response of responses; let i = index" class="card mb-3 shadow-sm">
        <div class="card-body">
            <h5 class="card-title">API {{ i + 1 }} Response:</h5>
            <p><strong>Status Code: </strong> <span class="badge badge-info">{{ response.status_code }}</span></p>
            <h6>Response Body:</h6>
            <div *ngIf="response.content_type.includes('application/json')">
                <pre class="bg-light p-3 rounded">{{ response.body | json }}</pre>
            </div>
            <div *ngIf="response.content_type.includes('application/xml') || response.content_type.includes('text/xml')">
                <pre class="bg-light p-3 rounded">{{ response.body }}</pre>
            </div>
            <div *ngIf="!response.content_type.includes('application/json') && !response.content_type.includes('application/xml') && !response.content_type.includes('text/xml')">
                <pre class="bg-light p-3 rounded">{{ response.body }}</pre>
            </div>
        </div>
    </div>
</div>
